import React, { useEffect, useState } from "react";
import { useCreateBookingMutation } from "../../redux/api/bookingApi";
import { useGetMeQuery } from "../../redux/api/userApi";
import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";
import toast from "react-hot-toast";

const AddBookingForm = ({ onClose, refetch }) => {
  const { data: users } = useGetMeQuery();
  const { data: flightTypes } = useGetFlightTypesQuery();
  const [createBooking] = useCreateBookingMutation();

  const [form, setForm] = useState({
    userId: "",
    from: "",
    to: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    remarks: "",
    status: "pending",
    totalAmount: 0,
  });

  const handleChange = (e) =>
    setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createBooking(form).unwrap();
      toast.success("Booking created successfully");
      refetch();
      onClose();
    } catch (err) {
      toast.error("Failed to create booking");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="border p-3 bg-light">
      <div className="row g-3">
        <div className="col-md-6">
          <label>User</label>
          <select
            className="form-select"
            name="userId"
            value={form.userId}
            onChange={handleChange}
            required
          >
            <option value="">Select User</option>
            {users?.map((user) => (
              <option key={user._id} value={user._id}>
                {user.name} ({user.email})
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-6">
          <label>Flight Type</label>
          <select
            className="form-select"
            name="flightType"
            value={form.flightType}
            onChange={handleChange}
            required
          >
            <option value="">Select Flight Type</option>
            {flightTypes?.map((ft) => (
              <option key={ft._id} value={ft.name}>
                {ft.name}
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-6">
          <label>From</label>
          <input
            className="form-control"
            name="from"
            value={form.from}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label>To</label>
          <input
            className="form-control"
            name="to"
            value={form.to}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label>Travel Date</label>
          <input
            type="date"
            className="form-control"
            name="travelDate"
            value={form.travelDate}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label>Travel Time</label>
          <input
            type="time"
            className="form-control"
            name="travelTime"
            value={form.travelTime}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-12">
          <label>Remarks</label>
          <textarea
            className="form-control"
            rows={3}
            name="remarks"
            value={form.remarks}
            onChange={handleChange}
          ></textarea>
        </div>
        <div className="col-md-12 d-flex gap-2 mt-3">
          <button type="submit" className="btn btn-success">
            Add Booking
          </button>
          <button type="button" onClick={onClose} className="btn btn-secondary">
            Cancel
          </button>
        </div>
      </div>
    </form>
  );
};

export default AddBookingForm;
